          Option 1 Layout
        </div>
      )}

      {selectedOption === 2 && (
        <div>
          {/* Layout for Option 2 */}
          Option 2 Layout
        </div>
      )}

      {selectedOption === 3 && (
        <div>
          {/* Layout for Option 3 */}
          Option 3 Layout
        </div>
      )}
    </div>

                </Stack>
                </MDBox>
              </MDBox>
            </Card>

          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Test;
